AD @revlon_uk came out with two eye-must-haves: shadow sticks and micro liners. The shadows are long wear and blend so easily – they’re perfect if your eyeshadow is creasing throughout the day and they come in two formulas: matte and shimmery! Also, the liners are super thin (1.5mm) which means you can create the finest smallest and most precise lines with them. xx #Longwear #ColorStay
@Revlon_UK
I’m using shades Sierra, Luster, Glit in the shadow sticks and Beige, Black in the liners

